import Vue from 'vue'
import App from './App.vue'
import VueRouter from 'vue-router';
import router from './router/index'
// import axios from './axios/index'
import axios from 'axios';

Vue.use(VueRouter);
Vue.use(axios);

new Vue({

  render: h => h(App),
  router,
  axios

}).$mount('#app')
